import React from "react";
import Greeting from "./Greeting";

function App() {
  return (
    <>
      <div>
        <h1>Hello, React!</h1>
        <p>i am saanvi welcome to my first page</p>
        <Greeting name="Alice" />
        <Greeting name="Bob" />
      </div>
    </>
  );
}

export default App;
